    StudentService.getAllStudents().then((response)=>{
        setStudent(response)
console.log(response.data);
    })

},[])
  return (
    <div className='container'>
      <h2 className="text-center"></h2>
      <table className='table table-bordered table-striped'>
<thead>
    <th>Student Id</th>
    <th>Student Name</th>
</thead>
<tbody>
    {
        student.map(
            student =>
            <tr key={student.id}>
                <td>{student.id}</td>
                <td>{student.name}</td>
            </tr>
        )
    }
</tbody>
      </table>
    </div>
  )
}

